const app = new Vue (
    {
        el: "#root",
        data: {
            images: [
                {
                    url: "data:image/jpeg;base64,",
                    titole: "img 1"
                },
                {
                    url: "data:image/jpeg;base64,",
                    titole: "img 2"
                },
                {
                    url: "data:image/jpeg;base64,",
                    titole: "img 3"
                }
            ],
            currentImg: 0,
        },
        methods: {
            nextImg: function() {
                if (this.currentImg < this.images.length - 1) {
                    this.currentImg += 1;
                } else {
                    this.currentImg = 0;
                }
            },
            previousImg: function() {
                if (this.currentImg < this.images.length - 1) {
                    this.currentImg += 1;
                } else {
                    this.currentImg = 0;
                }
            },
            selectImg: function(i) {
                this.currentImg = i;
            }
        }
    }
);